# https://leetcode.com/contest/weekly-contest-456/problems/partition-string/

class Solution(object):
    def partitionString(self, s):
        """
        :type s: str
        :rtype: List[str]
        """
        segments = []
        seen_segments = set()
        current_segment_chars = [] # Use a list for efficient character appending
    
        for i in range(len(s)):
            current_segment_chars.append(s[i])
            
            # Convert to string for set lookup *only when needed*
            temp_segment_str = "".join(current_segment_chars)
            
            if temp_segment_str not in seen_segments:
                segments.append(temp_segment_str)
                seen_segments.add(temp_segment_str)
                current_segment_chars = [] # Reset for next segment
        
        return segments

s = "abbccccd"
print(Solution().partitionString(s))

s = "aaaa"
print(Solution().partitionString(s))

